import React from "react";
import { useNavigate } from "react-router-dom"; // Importa o hook useNavigate
import "./styles.css";

const App = () => {
    const navigate = useNavigate(); // Usa o hook para obter a função de navegação

    return (
        <div>
            <header>
                <h1>Bem-vindo ao Meu Site com React</h1>
                <nav>
                    <button onClick={() => navigate("/about")}>Sobre</button>
                    <button onClick={() => navigate("/services")}>Serviços</button>
                    <button onClick={() => navigate("/contact")}>Contato</button>
                    <button onClick={() => navigate("/payment")}>Contato</button>
                </nav>
            </header>
            <main>
                {/* Conteúdo principal será gerido pelas rotas */}
            </main>
        </div>
    );
};

export default App;
